// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { AwPopupPrimaryButtonRenderFunction } from 'js/AwPopupPrimaryButtonService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPopupPrimaryButtonService', () => import('js/AwPopupPrimaryButtonService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "AwPopupPrimaryButtonRenderFunction",
            "deps": "js/AwPopupPrimaryButtonService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "action": {
            "type": "action"
        }
    },
    "_viewModelId": "AwPopupPrimaryButton",
    "_uniqueViewModelId": "AwPopupPrimaryButton",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, AwPopupPrimaryButtonRenderFunction, undefined, ctxImportObj );

export default Component;
